  \"2016-05-25T00:27:14.328781\",\n\t\"name\": \"commodity-flow-survey-2007-origin-destination-files-801ba\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Commodity Flow Survey (CFS) is the primary
  source of national and state-level data on domestic freight shipments by American
  establishments in mining, manufacturing, wholesale, auxiliaries, and selected retail
  industries. Data are provided on the types, origins and destinations, values, weights,
  modes of transport, distance shipped, and ton-miles of commodities shipped. The
  CFS is a shipper-based survey and is conducted every five years as part of the Economic
  Census. It provides a modal picture of national freight flows, and represents the
  only publicly available source of commodity flow data for the highway mode. The
  CFS was conducted in 1993, 1997, 2002, 2007 and most recently in 2012.\",\n\t\"license_title\":
